import React, { useContext, useEffect, useState } from 'react';
import noteContext from '../context/notes/noteContext';
import NoteItem from './NoteItem';
import AddNote from './AddNote';


const Notes = () => {
  const context = useContext(noteContext);
  const {notes, getNotes} = context;

    useEffect(() => {
        getNotes();
        // eslint-disable-next-line
    }, [])
    // const ref = useRef('');
    const [note, setnote] = useState({etitle : "", edescription : "", etag : "default"});
    const [isModalOpen, setModalOpen] = useState(false); // State to control modal visibility

    const updateNote = (currentNote) => {
      setnote({etitle: currentNote.title, edescription: currentNote.description, etag: currentNote.tag});
      // ref.current.click();
    }


    const handleClick =(e)=>{
      console.log("updating the note", note)
      e.preventDefault();
      setModalOpen(false);
    }

    const onChange = (e)=>{
      setnote({...note, [e.target.name]: e.target.value})
    }

  return (
    <>
      <AddNote />

      {/* Modal */}
      {isModalOpen && (
        <div className="modal fade show" style={{ display: 'block' }} id="exampleModal" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h1 className="modal-title fs-5" id="exampleModalLabel">Edit Note</h1>
                <button type="button" className="btn-close" onClick={() => setModalOpen(false)} aria-label="Close"></button>
              </div>
              <div className="modal-body">
                <form className="my-3">
                  <div className="mb-3">
                    <label htmlFor="title" className="form-label"><b>Title</b></label>
                    <input type="text" className="form-control" id="etitle" name="etitle" value={note.etitle} onChange={onChange} />
                  </div>
                  <div className="mb-3">
                    <label htmlFor="description" className="form-label"><b>Description</b></label>
                    <input type="text" className="form-control" id="edescription" name="edescription" value={note.edescription} onChange={onChange} />
                  </div>
                  <div className="mb-3">
                    <label htmlFor="tag" className="form-label">Tag</label>
                    <input type="text" className="form-control" id="etag" name="etag" value={note.etag} onChange={onChange} />
                  </div>
                </form>
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" onClick={() => setModalOpen(false)}>Close</button>
                <button onClick={handleClick} type="button" className="btn btn-primary">Update Note</button>
              </div>
            </div>
          </div>
        </div>
      )}


      <div className="row my-3">
            <h2>Your Notes</h2>
            {notes.map((note)=>{
              return <NoteItem key={note._id} updateNote={updateNote} note={note}/>
            })}
      </div>
    </>
  )
}

export default Notes
